// Footer.js
import './footer.css';
import React from 'react';

const Footer = () => {
  return (
    <footer className='background'>
      <div className='formlink'>
        {/* Use <a> tag for external link */}
        <a href='https://www.facebook.com/' target='_blank' rel='noopener noreferrer'>
          Say Hello
        </a>
      </div>
    </footer>
  );
};

export default Footer;
